Административный центр — официальный главный город любого административного образования первого, второго или третьего уровня (такого как область, край, автономная республика, провинция, штат, департамент). В административном центре, как правило, располагаются государственные органы власти и управления местного уровня: 
*  резиденция главы территории (губернатора, префекта); 
*  территориальный законодательный орган (местный парламент); 
*  начальники управления подразделений соответствующих государственных министерств и ведомств. Административный центр имеет инфраструктуру, которая связывает его с другими населёнными пунктами, обладает достаточным экономическим, культурным, кадровым потенциалом для осуществления управленческих функций. Поэтому во многих странах административными центрами являются, как правило, крупнейшие поселения в соответствующем регионе. При этом не всегда административный центр входит в это административно-территориальное образование. Так, например, Москва, Санкт-Петербург, Киев и Минск не входят в области, ими возглавляемые, Оренбург и Новосибирск не входят в одноименные районы, образуя городские округа Официальный главный город независимого суверенного государства называется столицей.
